(16, 34, 'Home', '<span>Welcome to Xebec International School and the colorful, creative, caring, confronting and sometimes chaotic life! Upon arrival at our school it becomes immediately apparent that you have entered a welcoming community school. From the first smile of our reception staff through to the buzzing throng of parents and students who gathers within the school yard eager to commence the school day.&nbsp;<br></span>Our Primary school is housed within two purpose built facilities and upon entering the school you are greeted by the laughter of our youngest students who inquire and learn through play. The school welcomes Playgroup students, who at three years of age enjoy the opportunity to explore and play alongside other young children. Our Nursery classrooms support the learning of four year old students. Their classrooms are filled with activities and learning tasks that promote creativity, inquiry and the development of independence. Both of these groups are offered a half day program five days per week in either am or pm sessions.', NULL, '3196.full.jpg', 38, NULL),
(18, 37, 'Home', 'Founded in 1979, our firm has been providing effective, affordable and often untraditional legal solution to our hundreds and thousands of clients over the years. Our law firm consists of remarkable team of expert trial attorneys in just about every field of law you can name, and it is because of this comprehensive nature of the legal services we provide, our firm has been able to stay ahead of its league for decades.', NULL, 'ISFS-students-on-green3.jpg', 43, NULL),
(19, 38, 'Home', '<span style="color: rgb(153, 153, 153); font-family: AmbleRegular; line-height: 19.5px; text-align: justify;">Welcome to UK Dental Clinic of Uttara in Bangladesh, wherever we tend to concentrate on providing you the gold commonplace in dental care. At UK Dental Clinic of Uttara at Dhaka in Bangladesh, we''ve encircled ourselves with friendly, compassionate thrust workers so you''ll have the simplest dental expertise attainable. we wish you to be comfy whereas we tend to maintain the health and look of your smile, and with a tranquil apply, friendly workers and gifted dentists, we tend to believe we''ve the formula for stellar service.</span>', NULL, NULL, 44, NULL),
(20, 40, 'Home', '<p align="justify" style="margin-top: -0.5em; margin-bottom: 1em; direction: ltr; font-family: ''Open Sans'', Arial, Helvetica, sans-serif; line-height: 21.75px; text-align: justify; color: rgb(85, 85, 85); font-size: 14.5px;">AHSAN Group (AG) is one of the leading conglomerates in Bangladesh. Since 1986 the group is operating business in diversified sectors including Readymade Garments (RMG), Trading, manufacturing, Export &amp; Import, Engineering &amp; Construction, Agro Business, Project Management, Investment, Housing &amp; Real-Estate etc.</p><p align="justify" style="margin-bottom: 0px; direction: ltr; font-family: ''Open Sans'', Arial, Helvetica, sans-serif; line-height: 21.75px; text-align: justify; color: rgb(85, 85, 85); font-size: 14.5px;">Ahsan Group enjoys independent corporate capacity and specializes in Import &amp; Export Business and agent of various commoditied and technology. Besides global sourcing, procurement of raw materials, equipment and spare parts from abroad for Oil &amp; Gas, Power, Energy &amp; Petrochemical sector, its business includes specialized engineering constructions, river &amp; channel gredging, roads &amp; railway construction, land &amp; housing project, processing raw materials on clients demand, sales of imported products, mechanical &amp; electrical equipment and other various materials and provide complete solution for turn key projects.</p>', NULL, NULL, 45, NULL),
