INSERT INTO `Testimonial` (`id`, `user_id`, `name`, `designation`, `title`, `slug`, `content`, `created`, `status`, `isFeature`, `path`, `globalOption_id`, `updated_at`) VALUES
(1, 34, 'Tanni', 'Junior Teacher', 'Xebec International School', 'xebec-international-school', '   : , , ,   ?  ?            -,         ,                         , -,                    ', '2016-04-29 16:57:44', 1, 1, 'Screenshot from 2015-11-05 08:53:07.png', 38, '0000-00-00 00:00:00'),
(2, 34, 'Welcome to Xebec International School and the colorful, c', 'Junior Teacher', 'Xebec International School', 'xebec-international-school', 'Welcome to Xebec International School and the colorful, creative, caring, confronting and sometimes chaotic life! Upon arrival at our school it becomes immediately apparent that you have entered a welcoming community school. From the first smile of our reception staff through to the buzzing throng of parents and students who gathers within the school yard eager to commence the school day. \r\n\r\nOur Primary school is housed within two purpose built facilities and upon entering the school you are greeted by the laughter of our youngest students who inquire and learn through play. The school welcomes Playgroup students, who at three years of age enjoy the opportunity to explore and play alongside other young children. Our Nursery classrooms support the learning of four year old students. Their classrooms are filled with activities and learning tasks that promote creativity, inquiry and the development of independence. Both of these groups are offered a half day program five days per week in either am or pm sessions.\r\n\r\nParents are seen as an integral part of our school community and they are welcomed into the learning partnership that is essential for students to experience success. Xebec International School is an inclusive school community that is committed to developing confident, skilled and successful global citizens.', '2016-04-30 15:29:23', 1, 0, '12167118_1178667888827128_196361870_n.jpg', 38, '0000-00-00 00:00:00'),
